

DROP TABLE IF EXISTS `airports`;

CREATE TABLE `airports` (
  `code` varchar(50) CHARACTER SET utf8 COLLATE utf8_turkish_ci NOT NULL,
  `name` varchar(200) CHARACTER SET utf8 COLLATE utf8_turkish_ci DEFAULT NULL,
  `city_code` varchar(50) CHARACTER SET utf8 COLLATE utf8_turkish_ci DEFAULT NULL,
  `city_name` varchar(200) CHARACTER SET utf8 COLLATE utf8_turkish_ci DEFAULT NULL,
  `country_name` varchar(200) CHARACTER SET utf8 COLLATE utf8_turkish_ci DEFAULT NULL,
  `country_code` varchar(200) CHARACTER SET utf8 COLLATE utf8_turkish_ci DEFAULT NULL,
  `timezone` varchar(8) CHARACTER SET utf8 COLLATE utf8_turkish_ci DEFAULT NULL,
  `lat` varchar(32) CHARACTER SET utf8 COLLATE utf8_turkish_ci DEFAULT NULL,
  `lon` varchar(32) CHARACTER SET utf8 COLLATE utf8_turkish_ci DEFAULT NULL,
  `num_airports` int(11) DEFAULT NULL,
  `city` varchar(32) CHARACTER SET utf8 COLLATE utf8_turkish_ci DEFAULT NULL,
  PRIMARY KEY (`code`)
) 

